namespace Day3
{
    internal class Program
    {
        static void Main(string[] args)
        {
            using (StringReader reader = new(DayInput))
            {
                double total = 0;
                string line;
                while ((line = reader.ReadLine()) != null)
                {
                    IEnumerable<char> first = line.Take(line.Length / 2);
                    IEnumerable<char> second = line.TakeLast(line.Length / 2);
                    char overlap = first.Intersect(second).First();
                    total += GetPriorityForChar(overlap);
                }

                Console.WriteLine("Total1: " + total);
            }

            using (StringReader reader = new(DayInput))
            {
                double total = 0;
                string line;
                string line2;
                string line3;
                while ((line = reader.ReadLine()) != null)
                {
                    line2 = reader.ReadLine();
                    line3 = reader.ReadLine();
                    char overlap = line.ToArray().Intersect(line2.ToArray()).Intersect(line3.ToArray()).First();
                    total += GetPriorityForChar(overlap);
                }

                Console.WriteLine("Total1: " + total);
            }
        }

        private static double GetPriorityForChar(char c)
        {
            if (char.IsUpper(c))
            {
                return c - 38;
            }
            else
            {
                return c - 96;
            }
        }

